import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Provider } from 'react-redux';

import {Link} from 'react-router-dom';
import './App.scss';

function App() {
  return (
    <>
      <Provider store={store}>
        <Header/>
        <BrowserRouter>
          <Routes>
            <Route index element={<Home />} />
            <Route path='home' element={<Home/>}/>
            <Route path='search' element={<SearchResults/>}/>
            <Route path='landingPages' element={<LandingPage/>}/>
            <Route path='setupAccount' element={<LandingPage slug='setup'/>}/>
            <Route path='setupAccountComplete' element={<LandingPage slug='thank-you'/>}/>
            <Route path='podcasts' element={<Categories kind='podcasts'/>}/>
            <Route path='articles' element={<Categories kind='articles'/>}/>
            <Route path='404' element={<Page404/>}/>
            <Route path='about' element={<StaticPage slug='about'/>}/>
            <Route path='terms' element={<StaticPage slug='terms'/>}/>
            <Route path='privacy' element={<StaticPage slug='privacy'/>}/>
            <Route path='cookies' element={<WithTitle title='Cookies' element={<Cookies/>}/>}/>
            <Route path='contactus' element={<WithTitle title='Contact Us' element={<ContactUs/>}/>}/>
          </Routes>
        </BrowserRouter>
      </Provider>
    </>
  );
}

export default App;
